<style type="text/css">
.wpmchimpa-overlay-bg {
background: rgba(0,0,0,{{data.theme.l3.lite_bg_op/100 ||'0.4'}});
height: 778px;
width: 1024px;
}

.wpmchimpa-overlay-bg #wpmchimpa-main {
min-width: 730px;
min-height: 350px;
background: {{data.theme.l3.lite_bg_c || '#fff'}};
display: inline-block;
position: relative;
left: 50%;
margin: 100px auto;
-webkit-transform: translatex(-50% );
-moz-transform: translatex(-50% );
-ms-transform: translatex(-50% );
-o-transform: translatex(-50% );
transform: translatex(-50% );
}
#wpmchimpa-main .wpmchimpa-leftpane{
width:230px;
height: 450px;
display: block;
background: #252b37;
background-image: url({{data.theme.l3.lite_img1||'data:image/svg+xml;base64,'}});
background-size: contain;
background-repeat: no-repeat;
background-position: center; 
float: left;
}
#wpmchimpa-main .wpmchimpa{
display: inline-block;
width: 380px;
margin: 40px 60px 0;
text-align: center;
}
#wpmchimpa .lite_heading{
margin-bottom:10px;
color: {{data.theme.l3.lite_heading_fc||'#888'}};
font-size: {{data.theme.l3.lite_heading_fs||'26'}}px;
line-height: {{data.theme.l3.lite_heading_fs||'26'}}px;
font-weight: {{data.theme.l3.lite_heading_fw}};
font-family: {{data.theme.l3.lite_heading_f | livepf}};
font-style: {{data.theme.l3.lite_heading_fst}};
}
#wpmchimpa .lite_msg,#wpmchimpa .lite_msg *{
color: #ff6160;
font-weight: 600;
line-height: 18px;
margin: 10px auto;
font-size: {{data.theme.l3.lite_msg_fs||'12'}}px;
font-family: {{data.theme.l3.lite_msg_f | livepf}};
}
#wpmchimpa .lite_tbox{
text-align: center;
margin-bottom: 10px;
width: 100%;
padding: 0 20px;
-webkit-border-radius: 1px;
-moz-border-radius: 1px;
border-radius: 1px;
outline:0;
display: block;
position: relative;
color: {{data.theme.l3.lite_tbox_fc||'#353535'}};
font-size: {{data.theme.l3.lite_tbox_fs||'17'}}px;
font-weight: {{data.theme.l3.lite_tbox_fw}};
font-family:Arial;
font-family: {{data.theme.l3.lite_tbox_f | livepf}};
font-style: {{data.theme.l3.lite_tbox_fst}};
background-color: {{data.theme.l3.lite_tbox_bgc||'#f0f0f0'}};
width: {{data.theme.l3.lite_tbox_w}}px;
height: {{data.theme.l3.lite_tbox_h||'50'}}px;
border: {{data.theme.l3.lite_tbox_bor||'0'}}px solid {{data.theme.l3.lite_tbox_borc}};
}
#wpmchimpa .lite_tbox div{
top: 50%;
-webkit-transform: translatey(-50% );
-moz-transform: translatey(-50% );
-ms-transform: translatey(-50% );
-o-transform: translatey(-50% );
transform: translatey(-50% );
position: relative;
}
.lite_tbox.mailicon:before,
.lite_tbox.pericon:before{
content:'';
display: block;
width: 50px;
height:50px;
position: absolute;
top: 0;
left: 0;
}
.lite_tbox.mailicon:before{
background: {{getIcon('a04',26,data.theme.l3.lite_inico_c||'#919191')}} no-repeat center;
}
.lite_tbox.pericon:before{
background: {{getIcon('c02',26,data.theme.l3.lite_inico_c||'#919191')}} no-repeat center;
}
#wpmchimpa .wpmchimpa-groups{
display: block;
}
#wpmchimpa .wpmchimpa-item{
display:inline-block;
margin: 2px 15px;
}
#wpmchimpa .lite_check {
cursor: pointer;
display: inline-block;
position: relative;
padding-left: 30px;
line-height: 14px;
}
#wpmchimpa .lite_check .cbox{
display: inline-block;
width: 12px;
height: 12px;
left: 0;
bottom: 0;
text-align: center;
position: absolute;
border:1px solid {{data.theme.l3.lite_check_borc}};
-webkit-border-radius: 1px;
-moz-border-radius: 1px;
border-radius: 1px;
-ms-transition: all 0.3s ease-in-out;
-moz-transition: all 0.3s ease-in-out;
-o-transition: all 0.3s ease-in-out;
-webkit-transition: all 0.3s ease-in-out;
transition: all 0.3s ease-in-out;
}
#wpmchimpa .lite_check .ctext{
color: {{data.theme.l3.lite_check_fc}};
font-size: {{data.theme.l3.lite_check_fs}}px;
font-weight: {{data.theme.l3.lite_check_fw}};
font-family: {{data.theme.l3.lite_check_f | livepf}};
font-style: {{data.theme.l3.lite_check_fst}};
}
#wpmchimpa .lite_check .cbox.checked{
background-color: {{data.theme.l3.lite_check_c}};
}
#wpmchimpa .lite_check .cbox.checked:after,#wpmchimpa .lite_check:hover .cbox:after{
display: block;
overflow: hidden;
width:12px;
height:12px;
content:'';
background: no-repeat center;
background-image:{{getIcon(data.theme.l3.lite_check_mark||'ch4',8,data.theme.l3.lite_check_ic||'#000')}};
}
#wpmchimpa .lite_check:hover .cbox:after{
opacity: 0.5;
}

#wpmchimpa .lite_button{
line-height: 50px;
text-align: center;
cursor: pointer;
margin-top: 15px;
text-align: center;
width: 100%;
color: {{data.theme.l3.lite_button_fc||'#fff'}};
font-size: {{data.theme.l3.lite_button_fs || "20"}}px;
font-weight: {{data.theme.l3.lite_button_fw}};
font-family: {{data.theme.l3.lite_button_f | livepf}};
font-style: {{data.theme.l3.lite_button_fst}};
background-color:{{data.theme.l3.lite_button_bc||'#ff6160'}};
width: {{data.theme.l3.lite_button_w}}px;
height: {{data.theme.l3.lite_button_h||'50'}}px;
-webkit-border-radius: {{data.theme.l3.lite_button_br||'1'}}px;
-moz-border-radius: {{data.theme.l3.lite_button_br||'1'}}px;
border-radius: {{data.theme.l3.lite_button_br||'1'}}px;
border: {{data.theme.l3.lite_button_bor||'1'}}px solid {{data.theme.l3.lite_button_borc||'#ff5757'}};
}
#wpmchimpa .lite_button:hover{
color: {{data.theme.l3.lite_button_fch}};
background-color: {{data.theme.l3.lite_button_bch||'#ff5757'}};
}
#wpmchimpa-main .wpmchimpa-close-button{
position: absolute;
display: block;
top: 0;
right: 0;
margin: 10px 20px;
cursor: pointer;
}
#wpmchimpa-main .wpmchimpa-close-button::before{
content: "\00D7";
font-size: 30px;
font-weight: 100;
color: {{data.theme.l3.lite_close_col||'#000'}};
opacity: 0.4;
}
#wpmchimpa-main .wpmchimpa-close-button:hover:before{
opacity: 1;
}

.lite_spinner {
margin: 15px 0;
}

.lite_status{
position: relative;
font-size: 18px;
margin-bottom: 15px;
}

#wpmchimpa-main .wpmchimpa-social{
display: inline-block;
margin: 5px auto;
}
#wpmchimpa-main .wpmchimpa-social::before{
content:"{{data.theme.l3.lite_soc_head||'Subscribe with'}}";
line-height: 30px;
display: block;
float:left;
margin-right: 20px;
color: {{data.theme.l3.lite_soc_fc}};
font-size: {{data.theme.l3.lite_soc_fs||'13'}}px;
font-weight: {{data.theme.l3.lite_soc_fw}};
font-family: {{(data.theme.l3.lite_soc_f | livepf)}};
font-style: {{data.theme.l3.lite_soc_fst}};
}

#wpmchimpa-main .wpmchimpa-social .wpmchimpa-soc{
width:30px;
height: 30px;
-webkit-border-radius: 1px;
-moz-border-radius: 1px;
border-radius: 1px;
float: left;
margin: 0 5px;
}
#wpmchimpa-main .wpmchimpa-social .wpmchimpa-soc::before{
display: block;
margin: 7px;
}

#wpmchimpa-main .wpmchimpa-social .wpmchimpa-soc.wpmchimpa-fb {
background: #2d609b;
}
#wpmchimpa-main .wpmchimpa-social .wpmchimpa-soc.wpmchimpa-fb::before {
content: {{getIcon('fb1',16,'#fff')}}
}
#wpmchimpa-main .wpmchimpa-social .wpmchimpa-soc.wpmchimpa-gp {
background: #eb4026;
}
#wpmchimpa-main .wpmchimpa-social .wpmchimpa-soc.wpmchimpa-gp::before {
content: {{getIcon('gp1',16,'#fff')}};
margin: 8px;
}
#wpmchimpa-main .wpmchimpa-social .wpmchimpa-soc.wpmchimpa-ms {
background: #00BCF2;
}
#wpmchimpa-main .wpmchimpa-social .wpmchimpa-soc.wpmchimpa-ms::before {
content: {{getIcon('ms1',16,'#fff')}}
}

#wpmchimpa .wpmchimpa-tag{
text-align: center;
display: {{data.theme.l3.lite_tag_en? 'block':'none'}};
}
#wpmchimpa .wpmchimpa-tag,
#wpmchimpa .wpmchimpa-tag *{
pointer-events: none;
color: {{data.theme.l3.lite_tag_fc||'#000'}};
font-size: {{data.theme.l3.lite_tag_fs||'10'}}px;
font-weight: {{data.theme.l3.lite_tag_fw}};
font-family:Arial;
font-family: {{data.theme.l3.lite_tag_f | livepf}};
font-style: {{data.theme.l3.lite_tag_fst}};
}
#wpmchimpa .wpmchimpa-tag:before{
content:{{getIcon('lock1',data.theme.l3.lite_tag_fs||10,data.theme.l3.lite_tag_fc||'#000')}};
margin: 5px;
top: 1px;
position: relative;
}
#wpmchimpa-main.woleft .wpmchimpa-leftpane{
display:none;
}
#wpmchimpa-main.woleft{min-width: 0}
#wpmchimpa-main.woleft #wpmchimpa-newsletterform{margin: 50px}
#wpmchimpa-main.wosoc .wpmchimpa-social {
display: none;
}
#wpmchimpa-main.wosoc #wpmchimpa-newsletterform{
margin-top: 30px;
}
</style>

<div class="wpmchimpa-overlay-bg wpmchimpa-wrapper" id="lightbox1">
	<div id="wpmchimpa-main" ng-class="{'woleft':data.theme.l3.lite_disimg,'wosoc':data.theme.l3.lite_dissoc}">
        <div class="wpmc-live-sc" ng-click="gotos($event)" data-optno="8" data-lhint="Go to Additional Theme Options" style="margin:15px;top:0">7</div>
        <div class="wpmchimpa-leftpane"></div>
		<div id="wpmchimpa-newsletterform">
			<div class="wpmchimpa" id="wpmchimpa">
    			<div><div class="wpmc-live-sc" ng-click="gotos($event)" data-optno="1" data-lhint="Go to Custom Message Settings">1</div>
            <div class="lite_heading">{{data.theme.l3.lite_heading}}</div>
      			<div class="lite_msg"><p ng-bind-html="data.theme.l3.lite_msg | safe"></p></div>
          </div>
          <div class="wpmchimpa-social">
            <div class="wpmchimpa-soc wpmchimpa-fb"></div>
            <div class="wpmchimpa-soc wpmchimpa-gp"></div>
            <div class="wpmchimpa-soc wpmchimpa-ms"></div>
          </div>
          <div><div class="wpmc-live-sc righthov" ng-click="gotos($event)" data-optno="2" data-lhint="Go to Text Box Settings" style="right: -20px;">2</div>
            <div class="lite_tbox pericon"><div class="in-name">Name</div></div>
      			<div class="lite_tbox mailicon"><div class="in-mail">Email address</div></div>
          </div>
          <div><div class="wpmc-live-sc" ng-click="gotos($event)" data-optno="3" data-lhint="Go to Checkbox Settings">3</div>
         		<div class="wpmchimpa-groups">
              <div class="lite_check_c"></div>
              <div class="wpmchimpa-item">
                  <div class="lite_check">
                    <div class="cbox"></div>
                    <div class="ctext">group1</div>
                  </div>
              </div>
              <div class="wpmchimpa-item">
                  <div class="lite_check">
                    <div class="cbox checked"></div>
                    <div class="ctext">group2</div>
                  </div>
              </div>
            </div>
          </div>
          <div><div class="wpmc-live-sc righthov" ng-click="gotos($event)" data-optno="4" data-lhint="Go to Button Settings" style="right: -20px;">4</div>
        		<div class="lite_button">{{data.theme.l3.lite_button}}</div>
          </div>
          <div><div class="wpmc-live-sc" ng-click="gotos($event)" data-optno="7" data-lhint="Go to Tag Settings">6</div>
	    		<div class="wpmchimpa-tag" ng-bind-html="data.theme.l3.lite_tag||'Secure and Spam free...' | safe"></div></div>
          <div>
          	<div class="wpmc-live-sc" ng-click="gotos($event)" data-optno="5" data-lhint="Go to Spinner Settings" style="right: -20px;">5</div>
          	<div class="lite_spinner" ng-bind-html="getSpin(data.theme.l3.lite_spinner_t||'4','wpmchimpa-wrapper',data.theme.l3.lite_spinner_c||'#000')"></div>
          </div>
    			
          </div>
			</div>
      <div class="wpmchimpa-close-button"></div>
	</div>        
</div>